  recovery plan for Indiana bats, a Federally endangered species. First revision.
  The purpose of this draft recovery plan is to provide natural resource management
  agencies and conservation groups with background information on the Indiana bat
  and indicate new or ongoing tasks needed to achieve eventual Federal and State delisting
  of the species. This document outlines the following:taxonomy, distribution and
  abundance, habitat, biology, recovery strategy and implementation schedule.\",\n\t\"license_title\":
